import React from "react";
import { Link } from "react-router-dom";

function AppHeader() {
  return (
    <header>
      <h1>CarTodo App</h1>
      <nav>
        <Link to="/">Todos</Link> | <Link to="/user">User</Link>
      </nav>
    </header>
  );
}

export default AppHeader;
